// Home.js
import React from 'react';

function Home() {
  const wrapperStyle = {
    minHeight: 'calc(100vh - 70px)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '20px'
  };

  const heroStyle = {
    maxWidth: '1000px',
    width: '100%',
    display: 'grid',
    gridTemplateColumns: '1fr 420px',
    gap: '50px',
    alignItems: 'start'
  };

  const titleStyle = {
    fontSize: '48px',
    lineHeight: 1.2,
    margin: '0 0 20px 0',
    color: '#f8fafc',
    fontWeight: '800'
  };

  const titleAccentStyle = {
    background: 'linear-gradient(135deg, #3b82f6, #10b981, #f59e0b)',
    WebkitBackgroundClip: 'text',
    WebkitTextFillColor: 'transparent',
    backgroundClip: 'text'
  };

  const subtitleStyle = {
    margin: '0 0 32px',
    color: '#cbd5e1',
    fontSize: '18px',
    lineHeight: 1.6,
    maxWidth: '500px'
  };

  const ctaGroupStyle = {
    display: 'flex',
    gap: '16px',
    flexWrap: 'wrap',
    alignItems: 'center'
  };

  const primaryBtn = {
    display: 'inline-flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '14px 28px',
    fontSize: '16px',
    fontWeight: '600',
    borderRadius: '12px',
    border: 'none',
    cursor: 'pointer',
    textDecoration: 'none',
    background: 'linear-gradient(135deg, #3b82f6 0%, #1d4ed8 100%)',
    color: 'white',
    boxShadow: '0 10px 25px rgba(59, 130, 246, 0.4)',
    transition: 'all 0.3s ease',
    position: 'relative',
    overflow: 'hidden'
  };

  const secondaryBtn = {
    display: 'inline-flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '14px 28px',
    fontSize: '16px',
    fontWeight: '600',
    borderRadius: '12px',
    border: '2px solid #475569',
    cursor: 'pointer',
    textDecoration: 'none',
    background: 'transparent',
    color: '#e2e8f0',
    transition: 'all 0.3s ease'
  };

  const simpleVisual = {
    width: '100%',
    height: '320px',
    borderRadius: '24px',
    background: 'linear-gradient(145deg, rgba(15,23,42,0.95) 0%, rgba(30,41,59,0.9) 100%)',
    border: '1px solid rgba(148,163,184,0.3)',
    padding: '32px',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    gap: '24px',
    boxShadow: '0 25px 50px rgba(15,23,42,0.8)'
  };

  const sentimentIconStyle = {
    width: '64px',
    height: '64px',
    borderRadius: '16px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '12px'
  };

  const positiveIcon = {
    ...sentimentIconStyle,
    background: 'linear-gradient(135deg, #10b981, #34d399)',
    color: 'white',
    boxShadow: '0 8px 20px rgba(16,185,129,0.4)'
  };

  const neutralIcon = {
    ...sentimentIconStyle,
    background: 'linear-gradient(135deg, #6b7280, #9ca3af)',
    color: 'white',
    boxShadow: '0 8px 20px rgba(107,114,128,0.4)'
  };

  const negativeIcon = {
    ...sentimentIconStyle,
    background: 'linear-gradient(135deg, #ef4444, #f87171)',
    color: 'white',
    boxShadow: '0 8px 20px rgba(239,68,68,0.4)'
  };

  const statsRow = {
    display: 'flex',
    gap: '20px',
    width: '100%',
    justifyContent: 'space-around'
  };

  const statItem = {
    textAlign: 'center',
    color: '#e2e8f0'
  };

  const statNumber = {
    fontSize: '28px',
    fontWeight: '800',
    color: '#f8fafc',
    display: 'block',
    lineHeight: 1
  };

  const statLabel = {
    fontSize: '12px',
    opacity: 0.8,
    marginTop: '4px',
    textTransform: 'uppercase',
    letterSpacing: '0.5px'
  };

  return (
    <main style={wrapperStyle}>
      <section style={heroStyle}>
        <div>
          <h1 style={titleStyle}>
            Advanced <span style={titleAccentStyle}>Sentiment</span> Analysis
          </h1>
          <p style={subtitleStyle}>
            Transform raw text into actionable insights. Detect positive, negative, and neutral 
            sentiments with precision scoring. Perfect for customer feedback, social media monitoring, 
            and market research.
          </p>

          <div style={ctaGroupStyle}>
            <a href="/admin-login" style={primaryBtn}>
              Start Analyzing
            </a>
            <a href="/analysis" style={secondaryBtn}>
              Live Demo
            </a>
          </div>
        </div>

        <div>
          <div style={simpleVisual}>
            <div style={statsRow}>
              <div style={statItem}>
                <div style={positiveIcon}>82%</div>
                <span style={statNumber}>82%</span>
                <span style={statLabel}>Positive</span>
              </div>
              <div style={statItem}>
                <div style={neutralIcon}>12%</div>
                <span style={statNumber}>12%</span>
                <span style={statLabel}>Neutral</span>
              </div>
              <div style={statItem}>
                <div style={negativeIcon}>6%</div>
                <span style={statNumber}>6%</span>
                <span style={statLabel}>Negative</span>
              </div>
            </div>
          </div>
        </div>
      </section>
    </main>
  );
}

export default Home;
